angular.module('sn.response_template_sidebar', []);
angular.module('sn.response_template_sidebar').directive('snHrSidebarPane', function($timeout, getTemplateUrl, paneManager) {
	'use strict';
	return {
		restrict: 'E',
		replace: true,
		transclude: true,
		templateUrl: getTemplateUrl('sn_hr_sidebar_pane.xml'),
		scope: {
			paneCollapsed: '=',
			panePosition: '@',
			paneResizeable: '@',
			paneWidth: '=',
			paneToggle: '@'
		},
		link: function(scope) {
			scope.togglePane = function() {
				paneManager.togglePane("hr_sidebar_pane", true);
			};
		}
	};
});
angular.module('sn.response_template_sidebar').directive('snHrSidebarContent', function(getTemplateUrl, paneManager) {
	'use strict';
	return {
		restrict : 'E',
		templateUrl: getTemplateUrl('sn_hr_sidebar_content.xml'),
		replace: true,
		scope : {
			collapsed: '=',
			url: '='
		},
		link: function(scope) {
			scope.$on('sn:url_changed', function(e, data){
				scope.url = data;
				scope.IframeSrcUrl = scope.url;
			});
			scope.closePane = function() {
				paneManager.togglePane("hr_sidebar_pane", true);
			};
		}
	};
});
;
/*! RESOURCE: scripts/controller.hrSidebar.js */
angular.module('sn.response_template_sidebar').controller('hrSidebar', function ($scope, $rootScope, $timeout, $http, $window, $location, $document, snCustomEvent, userPreferences, paneManager) {
  "use strict";
  $scope.hrSidebarCollapsed = true;
  $scope.loaded = false;
  $scope.content = '';
  $scope.actions = [];
  $scope.supressedTours = [];
  $scope.tours = [];
  $scope.showLanguageWarning = false;
  $scope.sysId = "";
  $scope.tableName = "";
  $scope.currentUrl = "";
  $scope.firstLoad = true;
  $scope.slidePanelOpen = false;
  paneManager.registerPane("hr_sidebar_pane");
  snCustomEvent.on("sn:hr_trigger_sidebar", function(args) {
    if (args.sysId != $scope.sysId || args.tableName != $scope.tableName) {
$scope.currentUrl = "/sn_templated_snip_message_template.do?sysparm_sys_id="+ args.sysId + "&sysparm_table_name=" + args.tableName + "&sysparm_nostack=true";
      $scope.sysId = args.sysId;
      $scope.tableName = args.tableName;
    }
    $scope.$broadcast('sn:url_changed', $scope.currentUrl);
    if($scope.hrSidebarCollapsed && !$scope.firstLoad){
        $document[0].getElementById('templateIframe').contentDocument.location.reload(true);
    }
    $scope.firstLoad = false;
    $scope.slidePanelOpen = true;
    paneManager.togglePane("hr_sidebar_pane", $scope.hrSidebarCollapsed);
  });
  
  snCustomEvent.on("sn:hr_sidebar_collapse",
			function() {
	           if($scope.slidePanelOpen)
	        	   paneManager.togglePane(
	        			   "hr_sidebar_pane",
	        			   true);
			});
  snCustomEvent.observe('hr_sidebar_pane.toggle', function(collapsed, autoFocusFirstItem) {
      if (!$scope.hrSidebarCollapsed)
          $scope.slidePanelOpen = false;  
      $scope.hrSidebarCollapsed = !$scope.hrSidebarCollapsed;
      $rootScope.$broadcast('hr_sidebar_pane.collapsed', 'right', $scope.hrSidebarCollapsed, autoFocusFirstItem);
      
      
      if($scope.firstLoad) {
        $rootScope.$broadcast('hr_sidebar_pane.collapsed', 'right', true, autoFocusFirstItem);
        $scope.firstLoad = false;
      }
       
  });
  $scope.$on('hr_sidebar_pane.collapsed', function (event, position, collapsed, autoFocusFirstItem) {
    var $body = angular.element('body');
    if ($body.data().layout) {
				if (collapsed) 
					$body.data().layout.hide('east');
				else {
					$body.data().layout.show('east');
					$body.data().layout.sizePane('east', 285);
				}
			} else {
        var $layout = angular.element('.navpage-layout'),
            $pageRight = angular.element('.navpage-right'),
            $snHrSidebar = angular.element('.navpage-inline-end-container.sn-hr-sidebar'),
            $snHrSidebarContent = angular.element('.sn-hr-sidebar-pane-content'),
            $layoutPolaris = angular.element('body.-polaris');
        if (collapsed) {
            $layout.addClass('navpage-right-hidden');
            $pageRight.css('visibility', 'hidden');
            $snHrSidebar.removeClass('-active');
            $snHrSidebarContent.addClass('sn-pane-hidden');
            $snHrSidebarContent.removeClass('sn-pane-visible');
            $layoutPolaris.removeClass('navpage-inline-end-visible');
        } else {
            $layout.removeClass('navpage-right-hidden');
            $pageRight.css('visibility', 'visible');
            $snHrSidebar.addClass('-active');
            $snHrSidebarContent.removeClass('sn-pane-hidden');
            $snHrSidebarContent.addClass('sn-pane-visible');
            $layoutPolaris.addClass('navpage-inline-end-visible');
        }
        if (autoFocusFirstItem) {
            $snHrSidebarContent.one('transitionend', function() {
              if ($snHrSidebarContent.hasClass('sn-pane-visible')) {
                $snHrSidebarContent.find('.sn-widget-list-item')
                  .filter(':visible')
                  .filter(':first')
                  .focus();
              }
            });
        }
      }
    });
  });
;
;
